import{_ as e,o as t,c as r,O as i}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 24.2-1002 Interference with registration.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-1002.md","filePath":"vacode/24.2-1002.md"}'),a={name:"vacode/24.2-1002.md"},o=i('<h1 id="§-24-2-1002-interference-with-registration" tabindex="-1">§ 24.2-1002 Interference with registration. <a class="header-anchor" href="#§-24-2-1002-interference-with-registration" aria-label="Permalink to &quot;§ 24.2-1002 Interference with registration.&quot;">​</a></h1><p>Any person who, by threats or force, interferes with or attempts to interfere with (i) any registrar in the discharge of his duty, (ii) any person applying to register or declining to apply to register, or (iii) any person going to or leaving a registration location as defined in Article 3 (§ <a href="http://law.lis.virginia.gov/vacode/24.2-411/" target="_blank" rel="noreferrer">24.2-411</a> et seq.) of Chapter 4 of this title or a polling place, or (iv) any person going to or leaving any other location at which persons offer mail applications under Article 3.1 (§ <a href="http://law.lis.virginia.gov/vacode/24.2-416.1/" target="_blank" rel="noreferrer">24.2-416.1</a> et seq.) of Chapter 4 of this title shall be guilty of a Class 1 misdemeanor.</p><p>Code 1950, § 24-116; 1970, c. 462, § 24.1-265; 1984, c. 480, § 24.1-49.01; 1993, c. 641; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1015" target="_blank" rel="noreferrer">1015</a>.</p>',3),n=[o];function s(c,l,h,p,f,g){return t(),r("div",null,n)}const v=e(a,[["render",s]]);export{d as __pageData,v as default};
